import axios from "axios";
const BASE_URL = "http://localhost:8080/";
class Serverservice {
  signup = (data) => {
    console.log("servic");
    console.log(data);
    axios.post(BASE_URL + "/auth/signup", data);
  };
}
export default new Serverservice();
